import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import Navigation from './components/Navigation'

function App() {
  return (
    <div className="App">
      <Navigation />
      <Navigation />
      <Navigation /><Navigation /><Navigation />
      <Navigation /><Navigation />
      <Navigation />
      <Navigation />
      <Navigation />
      <Navigation />

    </div>
  );
}

export default App;

